package N21;

import org.junit.Test;

import static org.junit.Assert.assertEquals;

/**
 * Created: shuai.li(286287737@qq.com)
 * Date: 2015-12-19
 */
public class N214_ShortestPalindrome_BTest {
    N214_ShortestPalindrome_B nb = new N214_ShortestPalindrome_B();

    @Test
    public void testShortestPalindrome() throws Exception {
        assertEquals("aaacecaaa", nb.shortestPalindrome("aacecaaa"));
        assertEquals("dcbabcd", nb.shortestPalindrome("abcd"));
        assertEquals("abc",
                nb.shortestPalindrome(""));
    }
}